import React from "react";
import Calendar from "./Calendar";

function Profile({ artists }) {
    const artistAppointments = artists.map((artist) => ({
        id: artist.id,
        name: artist.username, // or use the artist's name
        appointments: artist.appointments || [], // replace 'appointments' with the actual property name
    }));
    return (<div>
        <div>
            <h1>Artist Profiles</h1>
            {artistAppointments.map((artist) => (
                <div key={artist.id}>
                    <h2>{artist.name}'s Appointments</h2>
                    {artist.appointments.length > 0 ? (
                        <ul>
                            {artist.appointments.map((appointment) => (
                                <li key={appointment.id}>
                                    {/* Display appointment details */}
                                    Date: {appointment.date}, Time: {appointment.time}
                                </li>
                            ))}
                        </ul>
                    ) : (
                        <p>No appointments for {artist.name}.</p>
                    )}
                </div>
            ))}
        </div>
        <Calendar />
    </div>
    )
}

export default Profile
